import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Header from "./header.js";
import "./index.css";

// ROUTES
import Home from "./home.js";
import About from "./about.js";

function App() {
  return (
    <BrowserRouter>
      <Header />
      <main>
        <Routes>
          <Route className="route" path="/home" element={<Home />}></Route>
          <Route className="route" path="/aboutus" element={<About />}></Route>
        </Routes>
      </main>
    </BrowserRouter>

    // <BrowserRouter
  );
}

export default App;
